const LandingPage = ({ currentUser }) => {
  axios.get('http://localhost:3001/api/users/currentuser');
  console.log(currentUser);

  return <h1>Landing Page</h1>;
}

LandingPage.getInitialProps = async () => {
  const response = await axios.get('http://localhost:3001/api/users/currentuser');
  // const response = await axios.get('http://ingress-nginx.ingress-nginx.svc.cluster.local/api/users/currentuser');
  return response.data;
}

export default LandingPage;
